import React, { Component } from 'react'
import './styles.css'
import { storeproducts } from "../../components/homecontent/Data";
import { connect } from "react-redux";

class CartItems extends Component {
    constructor(props) {
        super(props)

        this.state = {
            products: storeproducts
        }
    }


    render() {
        // console.log(this.props);

        return (
            <div>
                <div className="container">
                    <table className="table table-condensed table-light table-bordered">
                        <thead><tr>
                            <th>Sl No</th>
                            <th>Name</th>
                            <th></th>
                            <th>Price</th>
                            <th>Quantity</th>
                            <th>Total</th>
                            <th>Action</th>
                        </tr></thead>

                        <tbody>
                            {this.state.products.map(product => (
                                <tr>
                                    <td>{product.id}</td>
                                    <td>{product.name}</td>
                                    <td>{product.name}</td>
                                    <td>{product.price}</td>
                                    <td>{product.name}</td>
                                    <td>{product.name}</td>
                                    <td>{product.name}</td>
                                </tr>
                            ))}
                        </tbody>

                    </table>
                </div>

            </div>
        )
    }
}

const mapStateToProps = (states) => {
    console.log(states);

    return {
        cart : states.CartItems
    }
}

export default connect(mapStateToProps)(CartItems)
